<?php

namespace App\Livewire\Pages\Invoice;

use Illuminate\Support\Facades\DB;
use Livewire\Attributes\Validate;
use Livewire\Component;

class FakturForm extends Component
{
    public ?string $idTagihan = null;

    public ?string $nomor = null;

    #[Validate('required|date')]
    public ?string $tanggal = null;

    #[Validate('required|digits:16')]
    public ?string $noFaktur = null;

    #[Validate('required|numeric')]
    public ?string $dpp = null;

    #[Validate('required|numeric|min:0')]
    public ?string $ppn = null;

    public ?string $pphPotong = null;

    #[Validate('required|min:10')]
    public ?string $keterangan = null;

    public function mount(?string $idTagihan = null, ?string $nomor = null, ?string $existingNoFaktur = null): void
    {
        $this->idTagihan = $idTagihan;
        $this->nomor = $nomor;
        $this->noFaktur = $existingNoFaktur;

        $tagihan = $this->tagihan();
        if ($tagihan && $tagihan->nilai) {
            $this->dpp = (string) $tagihan->nilai;
        }

        $kontrak = $this->kontrak();

        // Set PPN
        if ($kontrak && $kontrak->ppn_bayar_sendiri === 'ya') {
            $this->ppn = '0';
        } elseif ($tagihan && $tagihan->nilai && $tagihan->pajak) {
            $this->ppn = (string) (($tagihan->pajak / 100) * $tagihan->nilai);
        }

        // Set PPH23
        if ($kontrak && $kontrak->pph_potong === 'tidak') {
            $this->pphPotong = '0';
        } elseif ($tagihan && $tagihan->nilai) {
            $this->pphPotong = (string) ((2 / 100) * $tagihan->nilai);
        }
    }

    public function save(): void
    {
        $this->validate();

        // TODO: simpan data faktur
    }

    public function closeFakturModal(): void
    {
        $this->dispatch('close-faktur-modal');
    }

    public function tagihan(): ?object
    {
        if (! $this->idTagihan) {
            return null;
        }

        return DB::connection('mysql')->selectOne('
            SELECT
                *
            FROM
                erp_invoice.tagihan
            WHERE
                tagihan.id_tagihan = ?
            LIMIT 1
        ', [$this->idTagihan]);
    }

    public function kontrak(): ?object
    {
        $tagihan = $this->tagihan();

        if (! $tagihan || ! $tagihan->id_kontrak) {
            return null;
        }

        return DB::connection('mysql')->selectOne('
            SELECT
                *
            FROM
                erp_pelanggan.kontrak
            WHERE
                kontrak.id_kontrak = ?
            LIMIT 1
        ', [$tagihan->id_kontrak]);
    }

    public function address(): ?object
    {
        $tagihan = $this->tagihan();

        if (! $tagihan || ! $tagihan->id_pelanggan_kwitansi) {
            return null;
        }

        return DB::connection('mysql')->selectOne('
            SELECT *
            FROM erp_pelanggan.pelanggan_kwitansi
            WHERE id_pelanggan_kwitansi = ?
            LIMIT 1
        ', [$tagihan->id_pelanggan_kwitansi]);
    }

    public function items(): array
    {
        if (! $this->idTagihan) {
            return [];
        }

        return DB::connection('mysql')
            ->table('erp_pelanggan.kontrak_tagihan')
            ->join('erp_invoice.tagihan_item', 'kontrak_tagihan.id_kontrak_tagihan', '=', 'tagihan_item.id_kontrak_tagihan')
            ->join('erp_invoice.tagihan', 'tagihan_item.id_tagihan', '=', 'tagihan.id_tagihan')
            ->join('erp_pelanggan.lokasi', 'kontrak_tagihan.id_lokasi', '=', 'lokasi.id_lokasi')
            ->where('tagihan_item.id_tagihan', $this->idTagihan)
            ->selectRaw('lokasi.alamat_lengkap, kontrak_tagihan.kunjungan, (kontrak_tagihan.nilai - kontrak_tagihan.potongan) as nilai')
            ->get()
            ->map(fn ($item) => [
                'location' => $item->alamat_lengkap,
                'quantity' => $item->kunjungan,
                'nilai' => $item->nilai,
            ])
            ->toArray();
    }

